export const MEDIA_CONFIG = {
  API_KEY: process.env.REACT_APP_GOOGLE_API_KEY,
  CLIENT_ID: process.env.REACT_APP_GOOGLE_CLIENT_ID,
  FOLDERS: {
    MAIN: process.env.REACT_APP_MAIN_FOLDER_ID,
    PHOTOS: process.env.REACT_APP_PHOTOS_FOLDER_ID,
    VIDEOS: process.env.REACT_APP_VIDEOS_FOLDER_ID,
    MESSAGE_WALL: process.env.REACT_APP_MESSAGE_WALL_FOLDER_ID,
  },
};

export const APP_VARS = {
  WEDDING_DATE_TIME: process.env.REACT_APP_WEDDING_DATE_TIME || "", // ISO string with TZ
  VENUE_NAME: process.env.REACT_APP_VENUE_NAME || "",
  VENUE_ADDRESS: process.env.REACT_APP_VENUE_ADDRESS || "",
  COUPLE_FULL: "Abraham Jacobs & Jesse-Lee Nell",
  COUPLE_SHORT: "Abraham & Jesse-Lee",
};
